  false,\n\t\"url\": null,\n\t\"notes\": \"The primary objective of the study was
  to locate peregrine falcon nesting sites and to locate nest sites of other raptor
  species and assess their location in relation to potential disturbance from public
  use on the river. Additionally, we attempted to 1) gather productivity formation
  on each site encountered; 2) collect and identify prey remains found in nests; 3)
  band nestlings where possible; 4) observe and determine the origin of the banded
  adult peregrine photographed along the Noatak in 1985; and 5) establish a map and
  photographic file for all raptor nest sites encountered. Observations of all other
  birds and mammals were also recorded.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
